/*********************

*********************/
  
@import url(http://fonts.googleapis.com/css?family=Didact+Gothic);


/*********************
 reset
*********************/
html {margin:0;padding:0;border:0;}
body, div, span, object, iframe, h1, h2, h3, h4, h5, h6, p, blockquote, pre, a, abbr, acronym, address, code, del, dfn, em, img, q, dl, dt, dd, ol, ul, li, fieldset, form, label, legend, table, caption, tbody, tfoot, thead, tr, th, td, article, aside, dialog, figure, footer, header, hgroup, nav, section {margin:0;padding:0;border:0;font-weight:inherit;font-style:inherit;font-size:100%;font-family:inherit;vertical-align:baseline;}
article, aside, dialog, figure, footer, header, hgroup, nav, section {display:block;}
body {line-height:1.5;background:white;}
table {border-collapse:separate;border-spacing:0;}
caption, th, td {text-align:left;font-weight:normal;float:none !important;}
table, th, td {vertical-align:middle;}
blockquote:before, blockquote:after, q:before, q:after {content:'';}
blockquote, q {quotes:"" "";}
a img {border:none;}
:focus {outline:0;}


/*********************
 Common
*********************/
body{
    background: #282828 ;
}
aside{
    width: 60px;
    height: 70px;
    position: absolute;
    top: 0;
    left: 0;
    z-index: 100;
}
#main {
    width: 700px ;
    margin: 0 auto;
    position: relative;
}
.page{
    width: 640px;
    height: 940px;
    background: #efedd9;
    padding: 30px;
    margin: 30px 0 30px 0;
    position: relative;
}
.innerPage{
    width: 640px;
    height: 940px;
}
.block{
    width: 620px;
    height: 222px;
    margin: 10px;
    background: white;
    position: relative;
    overflow: hidden;
}
.words{
    border: 1px solid #000;
    border-radius: 35px/20px;
    font-family: "comic sans ms","comic sans","Chalkboard","Verdana",sans-serif;
    position: absolute;
    background: rgba(255, 255, 255, 0.8);
    padding: 12px;
}
.athor{
    width: 150px;
    height: 50px;
    border: 2px solid #888;
    position: absolute;
    top: 10px;
    left: 450px;
    z-index: 100;
    background: white;
    border-radius: 1px;
    padding: 3px 3px 3px 10px;
    max-width: 150px;
    font-family: 'Didact Gothic', sans-serif;
}
.film{
    position: absolute;
    top:0px;
    left: 0px;
    width: 620px;
    height: 222px;
    background: rgba(165, 140, 74, 0.5)
}

 Togling
*********************/
.gorizontal{
    width: 700px;
    height: 1030px;
    overflow: hidden;
}
#togler{
    width: 60px;
    height: 70px;
    background: #f90;
    position: relative;
}
#show{
    width: 60px;
    height: 70px;
    position: absolute;
    overflow: hidden;
    background: #0d1622;
    border: 1px solid #fff;
}
#min1{
    width: 50px;
    height: 60px;
    position: absolute;
    background: #fff;
}
#min2{
    width: 50px;
    height: 60px;
    position: absolute;
    background: #fff;
}
.vert1{
    top: -25px;
    left: 6px;
}
.vert2{
    top: 45px;
    left: 6px;
}
.gor1{
    top:5px;
    left:-25px;
}
.gor2{
    top:5px;

}
#left{
    width: 50%;
    height: 100%;
    position: absolute;
    top: 0px;
    left: 0px;
    display: none;
}
#right{
    width: 50%;
    height: 100%;
    position: absolute;
    top: 0px;
    right: 0px;
    display: none;
}

.keyboard{
    position: absolute;
    top: 160px;
    left: 40px;
    background: transparent;
}
.keyboard :last-child {
    width: 0;
    height: 0;
    border-left: 0px solid transparent;
    border-right: 8px solid transparent;
    border-top: 78px solid #000;
    position: absolute;
    top: 5px;
    left: 165px;
    -webkit-transform: rotate(60deg);
    -ms-transform: rotate(60deg);
    -o-transform: rotate(60deg);
    -moz-transform: rotate(60deg);
}
.keys{

}

            page[1].style.left = k + "px";
            k -= 10
        }
    }else{
        clearInterval(leftHendler);
    }
};
function moveRight(){
    if ((page[0].style.left <= "0px") && ramka.className == "gorizontal" ){
    page[0].style.left = i + "px";
        if( i < 0){
            i += 10;
        }
        if(i < -10){
            page[1].style.left = k + "px";
            k +=10
        }
    }else{
        clearInterval(rightHendler);
    }
};
function tog(){
    page[0].style.top = "0px";
    page[0].style.left= "0px";
    page[1].style.top = "";
    page[1].style.left= "";
    if (ramka.className == ""){
        ramka.className = "gorizontal";
        page[0].style.top = "0px";
        page[0].style.left= i + "px";
        page[1].style.top = "-1030px";
        page[1].style.left= k + "px";
        left.style.display = "block";
        right.style.display = "block";
        min1.className = "vert1";
        min2.className = "vert2"
    }else{
        ramka.className = "";
        page[0].style.top = "";
        page[0].style.left= "";
        page[1].style.top = "";
        page[1].style.left= "";
        left.style.display = "none";
        right.style.display = "none";
        min1.className = "gor1";
        min2.className = "gor2"
    }


};
setTimeout(function(){togler.style.display = "none"},10000);
app.onmouseover = function(){
    togler.style.display = "block";
};
app.onmouseout = function(){
    setTimeout(function(){
            togler.style.display = "none"
        }
    ,10000);
}

togler.onclick = tog;
left.onclick =  function(){
    leftHendler = setInterval(moveLeft, 1);
};
right.onclick = function(){
    rightHendler = setInterval(moveRight, 1);
};		
</script>
</body>
